export function login({ username, password }) {
    const formdata = new FormData()
    formdata.append("cqupt_id", username)
    formdata.append("password")
    fetch('https://wecuqpt.edu.cn/login', {
        method: "POST",
        headers: {
            "Content-Type": "form-data",
            "traefik": "user"
        },
        body: {
            username: username,
            password: password
        }
    })
}
